import React, {useState} from "react";
import "./styles/styles.scss";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./components/Pages/Home/Home";


export default function App() {
  const [completedFormState, setCompletedFormState] = useState (true)
  function handleCompletedForm(){
    setCompletedFormState(!completedFormState)
   }


  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home completedFormState setCompletedFormState handleCompletedForm={handleCompletedForm}/>} />
        <Route path="/completedForm" element={<Home completedFormState setCompletedFormState handleCompletedForm={handleCompletedForm}/>}/>
      </Routes>
    </BrowserRouter>
  );
}
